import Link from "next/link";
import Layout from "../components/myLayout";

export default function About() {
    return (
        <>
            <h3>Created By: </h3>
            <h2>Daniel</h2>
            <h2>Adam</h2>
            <h2>Sam</h2>
            <h2>Nazim</h2>
        </>
    )
}
